import React from "react";

export const HomepageWinners = () => {
  return (
    <div className={"d-flex "}>
      <div className={"col-md-5"}>
        <div className={"title2"}>Elivate Prize Winners</div> <img alt={'icon'} src={require('../../../assets/icons/prize.svg')}/>
      </div>
      <div className={"col-md-7"}>
        <div className={"title2"}>Elivate Prize Winners</div>
      </div>
    </div>
  )
}
